import React from 'react';

interface TitleProps{
  text: string;
  desc: string;
}

function Title(props: TitleProps){
  return(
  <h1>{props.text, props.desc}</h1>
  //<h2>{props.desc}</h2>
  )
}
function App() {
  return (
    <div className="App">
      <Title text="Título 1" desc="Esse é o primeiro título"/>
      <Title text="Título 2" desc="Esse é o segundo título"/>
      <Title text="Título 3" desc="Esse é o terceiro título"/>
      <Title text="Título 4" desc="Esse é o quarto título"/>
      <Title text="Título 5" desc="Esse é o quinto título"/>
    </div>
  ); 
}

export default App;
